import { createRouter, createWebHistory } from 'vue-router';
import Home from './components/Home.vue'; // Adjust paths as necessary
import About from './components/AboutCo.vue';
import Services from './components/ServicesComponent.vue';
import Booking from './components/BookingComponent.vue';
import Footer from './components/FooterComponent.vue';
import Header from './components/HeaderComponent.vue';
import Service from './components/ServiceComponent.vue';

const routes = [
  { path: '/', component: Home },
  { path: '/about', component: About },
  { path: '/services', component: Services },
  { path: '/booking', component: Booking },
  { path: '/footer', component: Footer },
  { path: '/header', component: Header },
  { path: '/service', component: Service }
];

const router = createRouter({
  history: createWebHistory(),
  routes
});

export default router;
